void *i51SapPullSkirtParameter(void)
{
	typedef struct
	{
		unsigned short *appname;
		int logosize;
		int dispsize;
		char logotype;//0 文字 1图片
		char gprsprompt;
		void *dispname;//游戏名称字模
		void *logo;//游戏说明 图片buffer或文字字模
	}BooterParam;
	static BooterParam param = {0};
	param.appname = L"PullSkirt";
	param.dispname = (void *)PullSkirt_dispname;
#if defined (__I51_APP_SCRIPT_TXT__)
	param.logotype = 0;
#elif defined (__I51_APP_SCRIPT_IMG__)
	param.logotype = 1;
#endif
#if defined(__I51_APP_GPRS_PROMPT__)
	param.gprsprompt = 1;
#else
	param.gprsprompt = 0;
#endif
	param.logo = (void *) PullSkirt_logo;
	param.dispsize = sizeof(PullSkirt_dispname);
	param.logosize = sizeof(PullSkirt_logo);
	return (void *)&param;
}
